29 de setembro, às 18h
Aula de Cultivo de Cogumelos Psicogênicos e o Impacto na Qualidade do Produto Final

Sobre o professor: Rafael é bacharel em Ciências Biológicas pela UNESP, responsável técnico e fundador da empresa Fungicultura, pioneira no Brasil em vendas de cultura líquida de espécies de cogumelos comestíveis e medicinais.

Na aula abordaremos:

- Breve história do cultivo de cogumelos;
- Espécies de Psilocybe;
- Ciclo de vida;
- Métodos de cultivo (esporos, clonagem, ágar, cultura líquida, spawn, casing, cultivo outdoor etc.);
- Strains e potência;
- Colheita, desidratação e armazenamento.

Atenção: Atualmente cultivar e vender cogumelos mágicos é proibido no Brasil. Aula com fins educacionais.

Garanta sua inscrição! LINK NA BIO

#psicodelico #fungicultura #cultivo #cogumelos #cogumelosmagicos #psilocybecubensis #psilocybe #psychedelic

